import{_ as e,p as a,q as p,a1 as r}from"./framework-5866ffd3.js";const h={},t=r('<h1 id="_07-30-重复周六" tabindex="-1"><a class="header-anchor" href="#_07-30-重复周六" aria-hidden="true">#</a> 07/30 重复周六</h1><p>今天的生活好像跟昨天没什么区别。</p><h3 id="交叉看病法" tabindex="-1"><a class="header-anchor" href="#交叉看病法" aria-hidden="true">#</a> 交叉看病法</h3><p>先是带奶奶去社区医院看牙病，诊断跟昨天一摸一样。</p><p>治疗方法也是一样，先根管治疗，再补牙。</p><p>不过这种两个地方同时问诊然后判断他们诊断是否一致的看病方法我觉得很靠谱。</p><p>因为“医生”是一个专业性很强的行业，当你面对一个很专业的人的时候，你会怕他骗你，这时候，你怎么办呢？</p><p>你可以去把问题抛给另一个专业的人，看他们给出的答案是否一致，让他们“专业互博”，如果诊断一致，则说明你的问题确实是这样，给出的解决方案也没有骗你。</p><p>我想对于其他专业人士诸如“律师”、“医生”、“程序员”这种方法都是通用的。</p><h3 id="拳击" tabindex="-1"><a class="header-anchor" href="#拳击" aria-hidden="true">#</a> 拳击</h3><p>午休过后，又是去了拳击。</p><p>不过今天上了擂台打，还挺好玩的。</p><p>本来我去练就是强身健体，减肥。</p><p>但是打完突然感觉这种竞技运动其实蛮安全，却很有趣味性。</p><p>给个视频你们瞅一眼。</p><h3 id="巨齿鲨" tabindex="-1"><a class="header-anchor" href="#巨齿鲨" aria-hidden="true">#</a> 巨齿鲨</h3><p>晚上看了部电影：《巨齿鲨》，因为《巨齿鲨2》要上映了。</p><p>这种片子没啥好说的，就是爽片，主打的就是肾上腺素狂飙的紧张刺激感。</p><p>另外就是8.30号诺兰的新作《奥本海默》要上映了，期待一下。</p>',19),d=[t];function n(c,i){return a(),p("div",null,d)}const o=e(h,[["render",n],["__file","30.html.vue"]]);export{o as default};
